import "mapbox-gl/dist/mapbox-gl.css";
import Map, { Layer, Source, MapRef, Marker } from "react-map-gl";
import React, {useRef, useState } from "react";
import { cellToBoundary } from "h3-js";
import Papa from "papaparse";


function MapBox() {

  const hexindex7Id = "8744a1024ffffff";


  const readFileData = (fileURL) => {

    const reader = new FileReader();

    console.log(reader);

    reader.onload = (e) => {
      const fileContent = e.target?.result;

      // Parse CSV data (using Papaparse library)
      const parsedData = Papa.parse(fileContent, { header: true });
      console.log(parsedData);

    };



    // Convert CSV to JSON
    // const data = parsedData.data.map((row: { [key: string]: string }) => {
    //   const newObj: { [key: string]: string } = {};
    //   Object.keys(row).forEach((key) => {
    //     newObj[key.trim()] = row[key].trim();
    //   });
    //   return newObj;

  }

  // console.log(cellToBoundary(hexindex7Id, true));

  readFileData("./assets/miami_hexagons.csv");


  return (
      <div>
        <div className="map">
          <Map
            initialViewState={{
              latitude: 25.917150273102553,
              longitude: -80.11504281788082,
              zoom: 10,
              bearing: 0,
              pitch: 0,
            }}
            mapStyle="mapbox://styles/mapbox/light-v9"
            mapboxAccessToken="pk.eyJ1IjoidGhlcHJvZiIsImEiOiJja3Q5amlqaXgxNjUwMm5wY3NrdmplbzVxIn0.C3zhU7lekidOJmARhNyBdw"
            style={{
              height: "100vh",
              width: "100vw",
            }}
          >
            <Source
              type="geojson"
              data= {{
                "type": "Feature",
                "geometry": {
                  "type": "Polygon",
                  "coordinates": [cellToBoundary(hexindex7Id, true)]
                },
                "id": "abc123"
              }}
            >
              <Layer
                {...{
                  id: "abc123",
                  type: "fill",
                  paint: {
                    'fill-outline-color': 'white',
                    "fill-color": "#E14C48",
                    "fill-opacity": 0.7,
                  },
                }}
              />

            </Source>



          </Map>
        </div> 
      </div>
  );

};

export default MapBox;
